using Microsoft.VisualStudio.TestTools.UnitTesting;
using Obligatorio.Domain;

namespace DomainTest
{
    [TestClass]
    public class TouristSpotTest
    {
        private TouristSpot myTouristSpot;

        [TestInitialize]
        public void SetUp()
        {
            myTouristSpot = new TouristSpot();
        }

        [TestMethod]
        public void TouristSpotConstructorNoParamTest()
        {
            Assert.AreEqual(myTouristSpot.Name, "Default Name");
            Assert.AreEqual(myTouristSpot.Description, "Default Description");
        }

        [TestMethod]
        public void NameTest()
        {
            myTouristSpot.Name = "La Paloma LightHouse";
            Assert.AreEqual(myTouristSpot.Name, "La Paloma LightHouse");
        }

        [TestMethod]
        public void DescriptionTest()
        {
            myTouristSpot.Description = "Very tall and traditional";
            Assert.AreEqual(myTouristSpot.Description, "Very tall and traditional");
        }

        [TestMethod]
        public void ImageTest()
        {
            myTouristSpot.Image = "data:image/jpeg;base64,";
            Assert.AreEqual(myTouristSpot.Image, "data:image/jpeg;base64,");
        }

        [TestMethod]
        public void EqualsIsNullTest()
        {
            Assert.IsFalse(myTouristSpot.Equals(null));
        }

        [TestMethod]
        public void EqualsIsNotEqualsTest()
        {
            TouristSpot anotherTouristSpot = new TouristSpot();
            anotherTouristSpot.Name = "Mercado del puerto";
            Assert.IsFalse(myTouristSpot.Equals(anotherTouristSpot));
        }

        [TestMethod]
        public void EqualsTest()
        {
            TouristSpot anotherTouristSpot = new TouristSpot();
            anotherTouristSpot.Name = "Mercado del puerto";
            myTouristSpot.Name = "Mercado del puerto";
            Assert.IsTrue(myTouristSpot.Equals(anotherTouristSpot));
        }

        [TestMethod]
        public void ToStringHasNoImageTest()
        {
            string s = string.Format("Tourist Spot called {0}, and its description is {1}.",
                myTouristSpot.Name, myTouristSpot.Description);
                s += "And has no image.";
            Assert.AreEqual(myTouristSpot.ToString(),s);
        }

        [TestMethod]
        public void ToStringHasImageTest()
        {
            myTouristSpot.Image = "kjyhgwedsfgykujidwe";
            string s = string.Format("Tourist Spot called {0}, and its description is {1}.",
                myTouristSpot.Name, myTouristSpot.Description);
            s += "And has an image.";
            Assert.AreEqual(myTouristSpot.ToString(), s);
        }

        [TestCleanup]
        public void TearDown()
        {
        }
    }
}
